window.bookSummaryJSON = "<p>Most people would be overjoyed to win $50,000 and the chance to star in a nation-wide commercial, even if it was just for a fast food joint like Camelot Burger. Then again, Clint Tucker has never been like most people. </p> <p>Ushered to the tropical paradise of Kenowai, he and the other winners undertake an island tradition for the cameras, one meant to free a local imprisoned deity. One with very specific requirements that have yet to be met. One that might just be a bit more authentic than any of them expected. One that will begin a journey fraught with danger, excitement, and more beer than is wise or healthy. </p>"; 
